import asyncio
from typing import Any

import httpx

from src.balance.headers import get_headers
from src.utils import HTTPRequests


async def batch_balance_check(addresses: list[str], client: HTTPRequests) -> dict[Any, Any] | None:
    params = {
        'ids': ','.join(addresses)
    }
    data = await client.get(
        asyncio.Semaphore(1),
        f"https://api.debank.com/user/desc_dict",
        params=params,
        headers=get_headers(params, "/user/desc_dict"),
    )

    if data["error_code"] == 0:
        accounts = {}
        desc_dict = data.get("data", {}).get("desc_dict", {})
        for wallet, wallet_data in desc_dict.items():
            accounts[wallet.strip().lower()] = round(wallet_data["usd_value"], 3)
        return accounts
    else:
        return None


async def main(wallets):
    a = []
    group_size = 50
    x = [wallets[i:i + group_size] for i in range(0, len(wallets), group_size)]
    async with httpx.AsyncClient() as client:
        session = HTTPRequests(client)
        for wallets in x:
            a += await batch_balance_check(wallets, session)
            await asyncio.sleep(1)
    print(a)
    print(len(a))


